import React, { useContext } from "react";
import { Link } from "react-router-dom";
import authContext from "../context/auth/authContext";

export default function Navbar() {
  const { user } = useContext(authContext);

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-white shadow fixed-top" style={{ zIndex: 1050 }}>
      <div className="container">
        <Link className="navbar-brand fw-light" to="/">
          {user?.admin ? `${user.name} Dashboard` : "MINIMAL"}
        </Link>

        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav">
          <span className="navbar-toggler-icon"></span>
        </button>

        <div className="collapse navbar-collapse" id="navbarNav">
          {!user?.admin && (
            <ul className="navbar-nav ms-auto gap-3">
              <li className="nav-item"><Link to="/women" className="nav-link">WOMEN</Link></li>
              <li className="nav-item"><Link to="/men" className="nav-link">MEN</Link></li>
              <li className="nav-item"><Link to="/about" className="nav-link">ABOUT</Link></li>
              <li className="nav-item"><Link to="/contact" className="nav-link">CONTACT</Link></li>
              <li className="nav-item"><Link to="/cart" className="nav-link">BAG (0)</Link></li>
            </ul>
          )}
        </div>
      </div>
    </nav>
  );
}
